// /src/pages/Home.js
import React, { useState } from 'react';
import Currency from '../../components/currency';
import GameSaves from '../components/gamesaves/gameSaves';

function Home() {
  const [gameState, setGameState] = useState({
    currency: 0, // Initial currency value
  });

  return (
    <div className="home">
      <h1>Welcome to Cookie Clicker Game</h1>
      {/* Pass gameState and setGameState to both components */}
      <Currency gameState={gameState} setGameState={setGameState} />
      <GameSaves gameState={gameState} setGameState={setGameState} />
    </div>
  );
}

export default Home;
